create table rng_divisions
(
    idrref       varchar(36)  not null
        constraint rng_divisions_pkey
            primary key,
    version      varchar(50)  not null,
    marked       varchar(5)   not null,
    predefinedid varchar(36)  not null,
    owneridrref  varchar(36)  not null,
    parentidrref varchar(36)  not null,
    folder       varchar(5)   not null,
    code         numeric(26)  not null,
    description  varchar(100) not null,
    fld2109      varchar(5)   default NULL::character varying,
    fld2110      varchar(150) default NULL::character varying,
    fld2111      varchar(50)  not null,
    fld12832     numeric(5)   default NULL::numeric,
    fld12833     varchar(5)   default NULL::character varying,
    fld13143     varchar(5)   default NULL::character varying,
    fld13504     varchar(36)  default NULL::character varying,
    fld13703     varchar(36)  default NULL::character varying,
    fld13704     varchar(36)  default NULL::character varying,
    fld532       varchar(36)  not null,
    uuid         varchar(40)  not null
);

alter table rng_divisions
    owner to postgres;

create index rng_divisions_idrref_idx
    on rng_divisions (idrref);

